INSERT INTO `phpbb_posts_text` (`post_id`, `bbcode_uid`, `post_subject`, `post_text`) VALUES (2,'1b8cbf8a6a','the Ziggurat !!','the new Butt Seaming table from Merrow \r\n\r\n[img:1b8cbf8a6a]http://www.merrow.com/images/ziggurat_side.jpg[/img:1b8cbf8a6a]'),(4,'12a0359796','about us (per merrow.com)','Quite simply put: Merrowing¨ IS overedge stitching.  We invented it and we pioneered its use worldwide.  \r\n\r\nAt Merrow we manufacture sewing machines, partner with designers, support enormous garment manufacturing operations, and take outstanding care of the cottage industry.\r\n\r\nMerrow is a company comprised of several elements-- each a compliment of the other. At our heart we are a brand, we are the Brand in the textile industry the has earned its right to be considered the mark of quality.  \r\n\r\n&quot;To Merrow¨&quot;, &quot;Merrowing¨&quot;, a &quot;Merrowed stitch¨&quot; Ðthese trademarked terms have come to stand for our unique array of stitching.  Stitching every bit as distinctive and recognizable today as it was when it was first introduced. Trademarked stitching that sells product to increasingly sophisticated and discerning consumers. The Merrow name represents an unparalleled excellence worldwide. \r\n\r\nOur wide variety of decorative edge finishes and solid construction stitching is ageless. The global consumer of Merrowed¨ goods, far removed from industrial sewing and our place in American history, still fully appreciates our brand as the benchmark of superior execution, enduring style and trendy fashion alike. Strength, substance and style, and flawless engineering resulting in stitch after perfect stitch are created by the Merrow line of machines today as always.'),(5,'0feee97357','Setting the lower looper #72','we\'ve put together a short #72 looper adjustment movie (1 minute 14 seconds) \r\n\r\nhttp://www.merrow.com/movies/72loopstream.mov\r\n\r\n-- this is just a test-- let us know what you think'),(6,'78e6640fd7','IS that how to set a looper','i\'m not sure i understand'),(7,'b20c76cb0a','Spare Parts','It probably goes without saying--- but all spare parts really should be purchased directly from Merrow-- or through certified dealers\r\n\r\ntoo often generic parts cause problems'),(8,'1ca8f4ef90','Looper adjustment','The video needs some voice over that explains what is going on, and what you are doing.  You should also someone to write and original jingle for all the intros to your video clips.... but where would you find someone with the know how AND the elbow grease to get it done?  Prehaps you already know someone.'),(10,'4dbbfa1f59','age determination of a Merrow machine','How old is your Merrow machine?  \r\n\r\nserial #/class/year\r\n5,000. . . . . . . . . . . . . . . . . . . . . . . . . 1906\r\n10,000. . . . . . . . . . . . . . . . . . . . . . . . 1912\r\n15,000. . . . . . . . . . . . . . . . . . . . . . . . 1916\r\n20,000. . . . . . . . . . . . . . . . . . . . . . . . 1919\r\n25,000. . . . . . . . . . . . . . . . . . . . . . . . 1921\r\n30,000. . . . . . . . . . . . . . . . . . . . . . . . 1924\r\n35,000. . . . . . . . . . . . . . . . . . . . . . . . 1925\r\n40,000. . . . . . . . . . . . . . . . . . . . . . . . 1926\r\n45,000. . . . . . . . . . . . . . . . . . . . . . . . 1927\r\n50,000. . . . . . . . . . . . . . . . . . . . . . . . 1930\r\n55,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1934\r\n60,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1936\r\n65,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1939\r\n70,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1940\r\n75,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1945\r\n80,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1947\r\n85,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1948\r\n90,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1949\r\n95,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . . 1950\r\n100,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . 1951\r\n105,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . 1952\r\n110,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . 1954\r\n112,000 [b:4dbbfa1f59]Class A and 60[/b:4dbbfa1f59] . . . . . . . . . 1955\r\n122,000 [b:4dbbfa1f59]Class M, A, and 60[/b:4dbbfa1f59] . . . . . . 1958\r\n130,000 [b:4dbbfa1f59]Class M, A, and 60[/b:4dbbfa1f59] . . . . . . 1960\r\n135,000 [b:4dbbfa1f59]Class M, A, and 60[/b:4dbbfa1f59] . . . . . . 1961\r\n140,000 [b:4dbbfa1f59]Class M, A, and 60[/b:4dbbfa1f59] . . . . . . 1962\r\n145,000 [b:4dbbfa1f59]Class M, A, and 60[/b:4dbbfa1f59] . . . . . . 1963\r\n150,000 [b:4dbbfa1f59]Class M, A, 60 and 70[/b:4dbbfa1f59] . . . . 1964\r\n155,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1965\r\n160,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1966\r\n165,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1967\r\n170,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1968\r\n175,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1969\r\n180,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1970\r\n185,000 [b:4dbbfa1f59]Class M and 70[/b:4dbbfa1f59] . . . . . . . . . 1972\r\n194,000. . . . . . . . . . . . . . . . . . . . . . . 1973\r\n199,000. . . . . . . . . . . . . . . . . . . . . . . 1974\r\n204,000. . . . . . . . . . . . . . . . . . . . . . . 1975\r\n207,000. . . . . . . . . . . . . . . . . . . . . . . 1976\r\n211,000. . . . . . . . . . . . . . . . . . . . . . . 1978\r\n216,000. . . . . . . . . . . . . . . . . . . . . . . 1979\r\n222,000. . . . . . . . . . . . . . . . . . . . . . . 1981\r\n227,000. . . . . . . . . . . . . . . . . . . . . . . 1983\r\n233,000. . . . . . . . . . . . . . . . . . . . . . . 1985\r\n237,000. . . . . . . . . . . . . . . . . . . . . . . 1987\r\n242,000. . . . . . . . . . . . . . . . . . . . . . . 1989\r\n245,000. . . . . . . . . . . . . . . . . . . . . . . 1991\r\n246,500. . . . . . . . . . . . . . . . . . . . . . . 1992\r\n248,000. . . . . . . . . . . . . . . . . . . . . . . 1993\r\n250,500. . . . . . . . . . . . . . . . . . . . . . . 1994\r\n252,500. . . . . . . . . . . . . . . . . . . . . . . 1995'),(11,'c4905faa03','help','what size pully do i need to use?'),(12,'1263532ddb','','I agree with the Captain. . . why buy generic parts when you can get them right from Merrow.'),(13,'a837325cfb','','pretty sweet'),(14,'f475d0aa2f','rubber feed dogs','are there rubber feed dogs for merrow machine? (rubber tipped :) )'),(15,'5cafa4ba7d','Re: rubber feed dogs','[quote:5cafa4ba7d=\"sewing&amp;growing\"]are there rubber feed dogs for merrow machine? (rubber tipped :) )[/quote:5cafa4ba7d]\r\n\r\nYes, rubber feed dogs are available, and used primarily for lighter fabric'),(16,'ae36e6ed86','Re: help','[quote:ae36e6ed86=\"crochet\"]what size pully do i need to use?[/quote:ae36e6ed86]\r\n\r\nWhat machine are you using?'),(17,'12b0883f4a','','M3PW-4? How old, what does it do, are there an attachements that can be used with it and what would it be worth? Also what kind of fabrics does it handle?\r\nThanks'),(18,'7f745387f8','M3PW-4 questions','M3PW-4? How old, what does it do, are there an attachements that can be used with it and what would it be worth? Also what kind of fabrics does it handle? How does one thread it?\r\nThanks'),(19,'3b61ecc256','3dw-4?','Are you sure it\'s not a M-3DW-4?\r\n\r\nif so, let me know-- i can tell you all about it'),(20,'41fe2427fc','Feed Dogs on different Fabrics','What feed dogs do you recommend to use on course gauge sweater material for M-Class Machines?\r\n\r\nThanks.'),(21,'dce5ba345d','Needles','I need to buy Merrow High Speed Needles.  What is the minimum order for needles?\r\n\r\nThanks.'),(22,'74b694f949','What needles go with the MG Class Machines?','Can you please advise as to what needles go with the MG Class machines?\r\n\r\nI have MG-3Q-3, MG-2-DNR-1, and MG-3U.\r\n\r\nThanks so much.'),(23,'847829d491','MG-3U AEM Model','I would like to know more about the MG-3U AEM model.\r\n\r\nCan it do only 4 shapes?  Does it support 220v?  What is the speed of the machine per hour?\r\n\r\nAlso, what is the shipping cost to Pakistan?'),(24,'','Part number for belt for the MG-3U?','What is the part number for the belt for the MG-3U?  I have two belts here, 1350 and 1360 and neither seem to fit.\r\n\r\nPlease advise.\r\n\r\nThanks.'),(25,'','Drive for Sewing Machine','Do you have any type of drive that adapts to the sewing machine that will pull the product as it is being sewn?\r\n\r\nI can send pics of what we currently use if that helps answer the question.\r\n\r\nThanks.'),(26,'','Merrow M-3DW-3 Serger','Hi!\r\n\r\nI have a Merrow m-3DW-3 serger that I bought used several years ago from a business owner closing their shop.  Is there a way to get an instruction manual for it?\r\n\r\nAlso, what is the primary use for this machine?  I seem to have issues with the tension, and I\'m not sure if it just needs to be adjusted, or if I am using it for the wrong purpose.  What types of fabrics is it intended for?  Your help would be GREATLY appreciated!  :)\r\n\r\nThank you!  Tina'),(27,'0b0b1de804','','Well, they\'ve been making those M-class machines for a long time.  Should be a serial number on the machine- that\'ll give you an idea of how old it is.'),(28,'f29d4eb2fc','','i\'m pretty sure they only sell them in packs of 25'),(29,'b197ad95c3','','Packs of 25 are the way needles are sold. Most durable needles around!  :)'),(30,'cdaaebd607','Technicians here to help!','Post here and your tech questions will be answered within 24 hours by a master Merrow(R) technician.'),(31,'57f5a3d5b5','','Yes! We have rubber feed dogs. What machine do you need them for?'),(32,'050d1a7ac4','Machines for Samples . . . Jean company','I am starting a jeans denim company and am looking for a small machine for me to use when making samples.  Are any of your smaller machines versatile enough to be able to produce a pair of jeans?  If so where and at what cost.\r\n\r\nThank you in advance.\r\n \r\n \r\nStephen'),(33,'31319e3d74','Convert MG Model to MG-3U?','Can you convert any MG Model to a MG-3U. What would be the cost in parts. (Rough Estimate)\r\n\r\nThanks.'),(34,'fdafc893c4','Butt-Seam 70-D3B-2','We are currently using a Merroe model:70-D3B, and sewing felt that is 1.5 mm thick for a total of 3 mm. We need to sew felt that is 4.5 mm thick for a total of 9 mm. Our current machine will not sew this thickness, what do you have that we can purchse to handle this thickness.\r\n\r\nThank you Merrow.'),(35,'033065b35b','Oil for M-Class Machine','Right now we are specifically in need of light weight oil for an M class\r\nmachine; how does it come, and what are the prices?  Please advise\r\navailability and lead time.\r\n\r\nThank you!!!'),(36,'44877a8b61','Thicker Material for Butt Seam Machine','We are currently using a Merrow model:70-D3B, and sewing felt that is 1.5 mm thick for a total of 3 mm. We need to sew felt that is 4.5 mm thick for a total of 9 mm. Our current machine will not sew this thickness, what do you have that we can purchse to handle this thickness.\r\n\r\nThank you Merrow.'),(37,'8afc9d3a65','Manual de Operacion','Hola Buenos dias mi nombre es Maricela Montelongo, trabajo para induatrias\r\nNEM de Mexico, S.A. de C.V. y nosotros tenemos aproximadamente 30 maquinas Merrows, y nosotros necesitamos bajar un manual de operacion en español, si usted me pudiera proporcionar la pagina web, donde yo pueda bajarlo se lo agradeceria muchisimo.\r\n\r\nMuchas gracias,\r\nMaricela Montelongo.'),(38,'aa32e37b2f','Merrow A - 3DW','I\'ve been looking for the exact manuals for this machine on your website and have now found any. Please point me in the right direction or send me the PDF\'s for this machine.\r\n\r\nSteve'),(39,'db1f50072b','Technical Manual','Dear Sir or Madam,\r\n \r\nDo you have a complete Technical Manual for the following sewing machine?\r\n \r\nStyle Number -- 70-D3B\r\n \r\nRegards,\r\n\r\nWQ'),(40,'ef695e484b','M-4DW-100 Overlocker','I recently purchased a M-4DW-100 overlocker.  Unfortunately, it came without a manual and I\'m having trouble threading the needles properly ... the left thread keeps getting caught in at the pivot joint in the needle carrier and breaking.  I\'m sure it is not threaded correctly.\r\n\r\nWhile your website is very helpful and I\'ve downloaded the available manual for the M/MG series machines, it does not have a threading diagram for a 4 thread overlocker.\r\n\r\nPlease let me know how I can obtain/buy a threading diagram specifically for my machine.\r\n\r\nThank you for your time.'),(41,'1f0b7825e6','A-BDW1 Manual','I am looking for an instruction manual for a Merrow Surger Style A-BDW1, Serial #64934.  Can youplease advise where I can find this?'),(42,'943658b63b','60Q Series Manual','I purchased a Merrow second hand and need to find needles.  I don\'t know the model number. The style is 60Q.  The serial no. is 41587. There is also a plate on the front with the number 539. None of these seem to correspond with the anything. I would also like to purchase an instruction manual if at all possible. Please respond is whatever way is quickest and most convienent.  Thank you so much for your help.'),(43,'f1774f508a','Rail . . . Used Maybe???','We have four 70db3s, two of which up and working on rails, one on a std table, and one in the wings…  We have an old rail (from Byars machine, sans drive controls and motor/wiring mounting set-up) that might be worth setting up with that 70bd3 but one of our ingenious tech employees found some ‘profiler’ rails on your site and we are wondering if Merrow or anyone has some used equipment or a rail-only piece that we could simply attach our 70db3 to?\r\n\r\nWe could use a rail to span at least 70 inches, &amp; it needs to include the drive &amp; traverse motors along with their related power/control electricals, as well as the mounting plate ready for the db3.\r\n\r\nAny thoughts?'),(44,'ad10e01804','Needle Plate - for MG-2DNR-1','We are from International company in Jakarta, Indonesia, a company which manufactures woven label. We have bought one of your machines, model: MG-2DNR-1 serial no. 266840. We have a problem with our machine and from Merrow web site I have identified the part that we want is the Needle Plate, part no. A7088.\r\n\r\nPlease tell us how to purchase this particular spare part and from who should we purchase it from. Thank you very much Sirs.'),(45,'ce4c7ca2cd','What do I need to change eccentrics?','Just bought an overlock machine . . . what do I need to changeout my eccentrics???  Is this difficult?'),(46,'ea61148acb','We have a High Pile solution','Hello, \r\n The Merrow sewing machine company offers a high pile solution for felt. Have a look at our website www.highpile.com  After you visit the site please give me a call at 800-431-6677 ext 641 or 508-295-8899 ext 641.  You may also email me at djelloe@merrow.com'),(47,'e1e0b9ed60','Rubber feed dogs','i have an MG-3DW-2 machine.  thanks for your help.'),(48,'e6a71d6b97','manuals for the 70-D3B-2','We do have manuals in stock. Please call Katie at 800-431-6677 ext 643 She will be glad to help you.'),(49,'62b3878199','','These machines can have different types of needles. If you would like, you can send pictures of the needles you have to bobby@merrow.com, or you can call a Merrow technician at 800-431-6677.'),(50,'d7f29f3680','','Please, send an e-mail to info@merrow.com, and we will assist you in purchasing this product.'),(51,'b9abbd6614','','Yes, we provide this type of drive. Please, send us an e-mail at info@merrow.com with information about your machine, the type of product that is being sewn and the type of product you are manufacturing. Thank you!'),(52,'622e09e2b1','','The MG-3U AEM can sew many different shapes. Please, send us pictures of your required shapes at info@merrow.com, and we will let you know if our machine can sew these shapes. \r\n\r\nThe machine supports 220v, and the topmost speed it can reach is 5500 stitches/minute. The shipping cost to Pakistan depends on your shipping preferences (e.g. by sea, by air, express, etc.). If you give us your preference at info@merrow.com, we will send you a quote on the price of the machine plus shipping.  \r\n\r\nYou can also go to www.emblemedge.com and learn more about the MG-3U machine.'),(53,'1d8574b6aa','M Class Questions','our products is sleepwear garment.\r\n\r\nfabric is 185g/m2 polar fleece or 180g/m2 1x1 rib or 180g/m2 jersey etc light weight knit fabric.\r\n\r\nthe stitching that we prefer is 3/8&quot; shell stitch.\r\n\r\nat same time,  we would like to use shiny thread.\r\n\r\npls kindly consider and adv if mg-3q-3 is possible to use with this combination of fabric, stitching, and shinyy thread.'),(54,'5ed3d0f178','On-site training?','I would like to be contacted concerning the possibility of on site training for 2 to 3 people on the proper replacement of parts and setting up machines. Please let me know if this is service you can provide. Thanks.'),(55,'23d9887ea3','Needles for 70-D3B','we have a sewing machine from you with style-no. 70-D3B and serial-no. 223717.\r\nCould you please tell us, if the needle N85D is the right for it and if you sell it.'),(56,'30ef2b9244','Old Serger','I have an old model 60 serger, and I believe the type is DEB. Is there any information on it?'),(57,'4fdbfbf668','Needles for A-3DW-3','I have a Merrow overlock machine that is older.  I am in need of replacement needles for this machine.  The style is A-3DW-3 and the serial number on my machine is 97987 with a note that it is from Hollister-Moreland Company out of Spartanburg, South Carolina.  Any help you can give me in finding these needles would be greatly appreciated.  Thank you!'),(58,'6aebc4f2b5','Convert MG to MG-3U?','Can you convert any MG Model to a MG-3U. What would be the cost in parts. (Rough Estimate)'),(59,'e140e8fe21','Taffeta, Twill, Satin?','We currently imprint fabric labels of different items like taffeta, twill,\r\nsingle and double face satin.  All this for garment labels with width upt\r\nto 2.5 inches.  We need this machines to sew together ends of tape rolls\r\nfor continuous printing.  Will 70 machine do this?  If ys, what series?'),(60,'1e7843e0ae','the looper carrier set screw','this link shows you the screw that needs to be tightened if the lower looper carrier is loose.\r\n\r\nhttp://picasaweb.google.com/merrow/Support3U?authkey=wZRYH37qghw'),(63,'d5a8183cb9','how many countries does merrow ship to?','In 2006, Merrow shipped to 85 countries worldwide. We have hundreds of distributors across the United States and the world. Our machines are hand-made by a team of skilled Merrow(R) technicians and we have thousands of machine models to sew nearly anything you can imagine!'),(80,'2f525269f3','','If you want versatility Merrow is definitely the way to go; with that new program you can put any stitch you want on those jeans and you don\'t have to pay thousands of dollars for machines.'),(81,'b157da5ad4','','Merrow came up with a solution for that problem not too long ago- the 70-HP can sew high pile fabrics.  Check out the high pile microsite.'),(82,'bd4f56ae72','High Pile Microsite?','Thanks.  What is the High Pile microsite address???  Thanks.'),(83,'ee4a0f0baa','','It\'s www.highpile.net.  Hope you find it helpful.'),(84,'fa57aac52f','','Each Merrow machine is hand-built to order and the configuration of the different machines in the field-- even within one class of machine-- number in the thousands. \r\n\r\nA Merrow technician would have to break down any machine and identify all the parts in order to know just what is needed.  Because of these challenges a conversion from one model to another is not cost-effective or supported by Merrow and no cost estimates can be made.  \r\n\r\nIf a Merrow Emblem machine is what you seek we would encourage you to visit our microsite: emblemedge.com or to contact info@merrow.com for a custom-tailored solution.\r\n\r\nThanks for your interest.\r\n\r\nLynne'),(85,'8a3453467b','','Hi Tina,\r\n\r\nMerrow manuals can be ordered by contacting info@merrow.com. We are working on making more information available on line.  \r\n\r\nYour machine can be used on a very wide range of fabrics and with a wide range of threads, but as our machines are hand-built and customized I cannot know for sure how your particular machine is configured.  The needles, needleplate,  feed dogs, eccentrics (stitch length) can be changed and all alter the machine\'s suitability for any given fabric and thread combination.  If you share some specifics of what you are trying to do with what fabric and thread combinations and the results (satisfactory or not) that you are getting I will be more than happy to try and make suggestions and trouble-shoot with you for optimum performance.\r\n\r\nThe M-3DW-3 machine is suitable for seaming and produces a perfectly precise stitch every time.  It is well-suited for stretch fabrics of all kinds and for elastic insertion.  But what you may find surprising is how well-suited this machine is for decorative stitching...especially with heavier threads in the loopers.  I have used it on fleece of all weights, denim AND gossamer-weight silks.  It handles every weight with equal ease.  Half the fun is experimenting! :D \r\n\r\nLet me know if I may help you with any specific tweaking of the machine for optimum results.  \r\n\r\nLynne'),(86,'284183dbd6','','Please see my answer to this question in the Applications forum.  Thanks.\r\n\r\nLynne'),(87,'9d78a87e32','','Hi Steve,\r\n\r\nOur manuals are available for ordering by contacting info@merrow.com.  Eventually we hope to have all our technical info available on line, but unfortunately, we don\'t just yet.  You have a great machine!\r\n\r\nLynne'),(88,'9984dc8d45','','Please contact info@merrow.com for any requests for manuals or information that you cannot find online @ merrow.com   Thank you.\r\n\r\nLynne'),(89,'','Thanks . . . thread recommendation?','Thank you!\r\n\r\nI\'m using the Merrow to make a partial edge around women\'s intimates wasteline and sometimes small decorative pockets.\r\n\r\nDo you sell thread or can you recommend a thread to use with fine luxe fabric?\r\n\r\nThanks so much!  Very helpful!!!'),(90,'e73cd2a75f','Converting to MG-3U','I don\'t follow.  All I want to do is convert a current M-Class machine to MG-3U.  I would just need the bill of materials for the M-Class machine I have and the bill for the MG-3U.  Would Merrow work with me to allow me to do this???\r\n\r\nMerrows are great machines, I\'ve worked with them in the past.  I\'d like to create an MG-3U from what I currently have.  I\'m quite confident I can adjust the machine if I have the appropriate parts.\r\n\r\nPlease advise.\r\n\r\nThank you Merrow!'),(91,'f828e63414','','I apologize if I didn\'t explain things clearly enough.  Let me address things specifically.\r\n\r\n[i:f828e63414]I would just need the bill of materials for the M-Class machine I have[/i:f828e63414]\r\n\r\nThere is the problem.  We don\'t know what that bill would be and it would potentially be very labor-intensive for our technicians to discover.  There are thousands of possible configurations.  An M-class machine is just that....a CLASS of machines and not a specific model.  The machine would have to be broken down.  It just isn\'t practical for Merrow to do.\r\n\r\nAgain, I\'m sorry, but Merrow does not support this kind of conversion.'),(92,'6c67952f39','','Thank you for sending in samples of your fabric for us to sew.  That is the very best way for us to show you what our machines can do for your applications.  Your samples are on their way back to you along with some other possibilities for decorative stitching on the fabrics you use.  \r\n\r\nWe look forward to hearing from you once you have reviewed the sewn samples.'),(93,'74f98a9049','','Yes, a 70 series machine will do this beautifully for you and you also have the option of adding a rail system for ease  and speed of the sewing process.  The best way for us to know just what machine would work best for your materials would be for you to send us fabric samples and allow us to do a free stitch sample for your particular product.  \r\n\r\nPlease contact me (lynne@merrow.com) and I will be happy to personally work with you to find your ideal solution.'),(94,'4d10965fad','','There is no one belt part number for any Merrow machine since the pulley, motor, table and set-up all affect the belt specifics.  \r\n\r\nPlease email our customer technician, Woody, (woody@merrow.com) and he will be happy to assist you in finding the right belt for your set up and identify just what your difficulties are and help solve them.  Thank you.'),(95,'d0f5512d95','','There is no one belt part number for any Merrow machine since the pulley, motor, table and set-up all affect the belt specifics.  \r\n\r\nPlease email our customer technician, Woody, (woody@merrow.com) and he will be happy to assist you in finding the right belt for your set up and identify just what your difficulties are and help solve them.  Thank you.'),(96,'6ebdfa893a','','That needle is not a Merrow needle.  Please contact Merrow at info@merrow.com and we will be happy to supply you with genuine Merrow needles that will suit your particular application.  Thank you.'),(97,'fd5d72b0f4','','While we would be happy to call you  if we come across a used rail system from a customer who is upgrading, the likelihood of that happening is slim.  please share your info with me at: lynne@merrow.com  \r\n\r\nWe sell a variety of new rail systems and would be happy to assist you with your needs.'),(98,'8c54fc9219','Changing the eccentrics on your Merrow sewing machine.','<b>****Before attempting any service procedure PLEASE TURN OFF your machine motor**** </b>\r\n\r\nChanging eccentrics, with practice, is about a 5-10 minute job.  You need two tools....a 5/16&quot; socket wrench and a Merrow eccentric extractor (part # 6-155).\r\n\r\nOpen the feed cover on the left side of the machine.  You will see two black 5/16&quot; nuts.  The one closest to the front of the machine holds the eccentrics...remove that one...and loosen the one in the back a turn or a turn and a half.  \r\n\r\nThe eccentric extractor has a u-shaped end.  Place the flattened tip of the U behind the eccentrics.  The length of the tool should be parallel to the floor with the ring flat side to the floor and to your left and the U-shaped tip of the tool to your right with the hook tip facing away from you.\r\n\r\nPut the hook behind the feed carrier link (behind the outer-most eccentric) up against the shaft and wiggle the handwheel with your right hand while pulling with the tool in your left so that the eccentric slides off the end of the shaft.  \r\n\r\nThe second eccentric will wiggle part way out in like manner and then needs to be further pulled out with your fingers through both feed carrier links.\r\n\r\nWhen replacing eccentrics remember that the inner eccentric controls the front feed dogs and the outer eccentric controls the rear feed dogs.  \r\n\r\nThere is a slot in the eccentric that lines up with a key on the shaft, so when inserting the new eccentric please wiggle it in and not force it.  Turning the handwheel slightly helps with this process.  It will slide into the outer feed carrier link easily but then requires slight pressure to slide into the inner feed carrier link.  Using the feed eccentric tool push on the eccentric gently with the flat spot on the bottom of the &quot;U&quot; up against the eccentric while wiggling the handwheel until it engages with the inner feed carrier link.\r\n\r\nEngage the second (outer) eccentric in like manner.\r\n\r\n[i:8c54fc9219]Before you tighten the 5/16&quot; nuts back up make <b>sure</b>  the handwheel turns easily letting you know that everything is aligned properly.  There should be no binding or grinding.[/i:8c54fc9219]\r\n\r\nThe 5/16&quot; nut should go on most of the way without the socket wrench if the eccentrics are where they should be.\r\n\r\nThat\'s it.  Congratulations, you\'ve just changed your eccentrics. :D'),(99,'1398de636b','','Please contact info@merrow.com for pricing and availability.  Thanks for your  interest.'),(100,'3bf5f5a994','','You might have single or double row feed dogs in your existing machine (needle plate and feed dogs).  Each Merrow machine is hand-built to customized specifications so it is impossible to know exactly how your machine might be configured or if it has special feed dogs or needle plates without seeing it.\r\n\r\nThat said, I would recommend fine feed dogs for any knit...even a coarse knit, because the heavier feed dogs are pretty aggressive.  The only way I can possibly see using a coarser feed dog on a knit is if you are doing are a very long stitch length.  Let me know if that is the case.  Otherwise, here are the part #s for the fine feed dogs:\r\n\r\nIf you have a single row feed dog part #s: A-81-11 (front) and A-81-43 (rear)\r\n\r\nIf you have double row feed dogs you need part #s:  A-81-2 (front) and A-81-4'),(101,'25c95ea536','Cobie Smulders free video and pics gallery','[url=http://berteyuly.isuisse.com/Amatuers-free-movie-clip.html]Amatuers free movie clip[/url] [url=http://berteyuly.isuisse.com/Underage-Sex-Pics-free-video-clip.html]Underage Sex Pics free video clip[/url] [url=http://berteyuly.isuisse.com/Cheek-Spanked-free-movie-clip.html]Cheek Spanked free movie clip[/url] [url=http://berteyuly.isuisse.com/Masterbate-free-movie-clip.html]Masterbate free movie clip[/url] [url=http://berteyuly.isuisse.com/Belle-Black-Secretaire.html]Belle Black Secretaire[/url] [url=http://berteyuly.isuisse.com/Utah-Dmv-free-video-clip.html]Utah Dmv free video clip[/url] [url=http://